DROP TABLE IF EXISTS #store_source_deal_detail

CREATE TABLE #store_source_deal_detail (
	deal_id NVARCHAR(MAX),
	term_start DATETIME,
	term_end DATETIME,
	Leg INT
)  












		
UPDATE Source_deal_detail
	SET cycle = 41000  
FROM source_deal_detail sdd
INNER JOIN source_deal_header sdh 
	ON sdh.source_deal_header_id = sdd.source_deal_header_id
INNER JOIN #store_source_deal_detail ssdd 
	ON sdh.deal_id = ssdd.deal_id 
	AND sdd.term_start = ssdd.term_start 
	AND sdd.term_end = ssdd.term_end 
	AND sdd.leg = ssdd.Leg




	


